Across the United States, relative public interest in elective TJA has sharply declined since the WHO declaration identifying COVID-19 as a global pandemic on March 11, 2020 [3]. Specifically, between March 1, 2020 and March 29, 2020, the relative popularity of searches for “Knee Replacement,” “Hip Replacement,” and “Orthopedic Surgeon” declined by 62.1%, 52.1%, and 44.3% respectively (Figure 1
A-1C). The 5-year average GSVI values for these search terms were 72.1, 55.2, and 63.7 respectively. To account for seasonal variation, GSVI values for April of each year between 2015 and 2020 were assessed as well (Table 1
). For each search term, the drop in GSVI values observed during March of 2020 breeched the lower control limit, approximating three standard deviations below the five-year mean. According to standard SPC methodology, this drop signifies a non-random variation in the GSVI data. The decline was the most significant for “Knee Replacement” searches, followed by “Hip Replacement” and “Orthopedic Surgeon” searches, respectively. A concurrent spike was apparent in March 2020 for the search term “Elective Surgery Cancellation,” with an observable peak on March 15, 2020 (Figure 2
).

States with the lowest GSVI values for “Knee Replacement,” “Hip Replacement,” and “Orthopedic Surgeon” were the District of Columbia, District of Columbia, and North Dakota, respectively. Meanwhile, the states with the highest number of confirmed COVID-19 cases (as of April, 2020) were determined to be New York, New Jersey, Massachusetts, Illinois, and California. California was identified among the bottom 5 states for search popularity of knee and hip replacements, while also being in the top 5 states for the number of COVID-19 cases (Figure 3
A-3C; Table 2
). Interestingly, Louisiana and North Carolina were observed among the bottom five states for TJA related searches, while also experiencing the greatest increases in average weekly unemployment claims (Table 2). An analysis of U.S. Census regions revealed slight geographic variations, although none determined to be statistically significant (Figure 4
).

Current public health policies in response to the pandemic are demonstrated in Figure 5
. These responses varied across states and range from no social distancing mandate (“limited action”) to mandatory quarantine alongside the complete suspension of all nonessential activities (“stay at home order”). A comparison of states issuing mandatory shelter-in-place orders against states that did not, showed the former group to have greater decreases in GSVI values for TJA related searches (Table 3
). Notably, GSVI values for “Orthopedic Surgeon” searches decreased on average by -4.49 (15.17) in shelter-in-place states compared to an average increase of +11.50 (24.18) in non-shelter-in-place states. Similarly, for “Knee Replacement” searches, average GSVI values decreased by -7.67 (19.31) in shelter-in-place states, while increasing by +0.50 (19.12) in non-shelter-in-place states. However, neither of these differences was determined to be statistically significant (p = 0.19865 and p = 0.28619 respectively). An additional analysis comparing states by reopening status as of May 9, 2020, revealed states in the process of reopening to have slightly smaller decreases in GSVI values compared to states remaining closed for the time being (Table 4
). However, these findings similarly did not reach the level of statistical significance.
